import React from 'react'

import Container from '../components/container'
import Footer from '../components/footer'
import Header from '../components/header'

const Pedido = () => (
    <>
        <Header />
        <Container>
        <h1>Pedido</h1>
        </Container>
        <Footer />
    </>
)


export default Pedido


